import React from "react";

const navLinks = [
  { to: "#", text: "Home" },
  { to: "#description", text: "About Us" },
  { to: "#multicards", text: "Solutions" },
  { to: "#blogs", text: "Blogs" },
  { to: "#contact", text: "Contact Us" },
];

const Header = () => {
  return (
    <div className="flex gap-16  text-white justify-center items-center p-6 fixed bg-[#392B85] w-full z-20 cursor-pointer">
      <span className="contrast-75">Home</span>
      <span className="contrast-75">About Us</span>
      <span className="contrast-75">Solutions</span>
      <span>
        <img src="images/logo 1.png" alt="logo" />
      </span>
      <span className="contrast-75">Blogs</span>
      <span className="contrast-75">Trials</span>
      <span className="contrast-75">Contact Us</span>
    </div>
  );
};

export default Header;
